import React, { useEffect, useState } from 'react';

function HeaderInfo() {
    const [currPosition, setCurrPosition] = useState({ lat: 0, lng: 0 });

    navigator.geolocation.getCurrentPosition((position) => {
        setCurrPosition({ lat: position.coords.latitude, lng: position.coords.longitude });
    });

    return (
        <>
            <div>
                <h2>Geocacher</h2>
            </div>
            <div>
                <h3>Current Location</h3>
                <h3>Latitude: {currPosition.lat !== 0 ? currPosition.lat : null}</h3>
                <h3>Longitude: {currPosition.lng !== 0 ? currPosition.lng : null}</h3>
            </div>
        </>
    )

}

export default HeaderInfo;
